import React from "react";
import { useState, useEffect, useMemo } from "react";
import { useHistory } from "react-router-dom";
import CheckCircleIcon from "@material-ui/icons/CheckCircle";
import CloseIcon from "@material-ui/icons/Close";

import TableComponent from "../Components/TableComponent";
import NavbarComponent from "../Components/NavbarComponent";

const axios = require("axios");

function HomePage() {
  const [result, setResult] = useState([]);
  let history = useHistory();

  const columns = useMemo(
    () => [
      {
        Header: "My Clients",
        columns: [
          {
            Header: "Id",
            accessor: "id",
            sortType: "basic",
          },
          {
            Header: "Name",
            accessor: "name",
            sortType: "basic",
          },
          {
            Header: "Client Manager",
            accessor: "clientManager",
            sortType: "basic",
          },
          {
            Header: "Tier Description",
            accessor: "tierDescription",
            sortType: "basic",
          },
          {
            Header: "Sector Description",
            accessor: "sectorDescription",
            sortType: "basic",
          },
          {
            Header: "Last Update",
            accessor: "lastUpdate",
            sortType: "basic",
            Cell: ({ cell: { value } }) => new Date(value).toString(),
          },
          {
            Header: "procurementStatus",
            accessor: "Procurement Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => 
                {if (value === "OK"){
                     return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                   }else{ 
                    return (<CloseIcon style={{ color: "#C71E03" }} />);
                  }}
            
          },
          {
            Header: "linkedinStatus",
            accessor: "LinkedIn Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => {
                {if (value === "OK"){
                    return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                  }else{ 
                   return (<CloseIcon style={{ color: "#C71E03" }} />);
                 }}
            },
          },
          {
            Header: "contactStatus",
            accessor: "Contact Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => {
                {if (value === "OK"){
                    return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                  }else{ 
                   return (<CloseIcon style={{ color: "#C71E03" }} />);
                 }}
            },
          },
          {
            Header: "accountIntellyStatus",
            accessor: "Account Intelligence Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => {
                {if (value === "OK"){
                    return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                  }else{ 
                   return (<CloseIcon style={{ color: "#C71E03" }} />);
                 }}
            },
          },
          {
            accesor: "partnerStatus",
            Header: "Partment Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => {
                {if (value === "OK"){
                    return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                  }else{ 
                   return (<CloseIcon style={{ color: "#C71E03" }} />);
                 }}
            },
          },
          {
            Header: "offeringStatus",
            accessor: "Offering Status",
            sortType: "basic",
            Cell: ({ cell: { value } }) => {
                {if (value === "OK"){
                    return (<CheckCircleIcon style={{ color: "#64A205" }} />);
                  }else{ 
                   return (<CloseIcon style={{ color: "#C71E03" }} />);
                 }}
            },
          },
        ],
      },
    ],
    []
  );

  const fetchData = async () => {
    axios
      .get(`${process.env.REACT_APP_API_ROOT_URL}/client-management/clients`, {
        headers: {
          Authorization: "Bearer " + sessionStorage.getItem("user_token"),
        },
      })
      .then(function (response) {
        setResult(response.data);
      })
      .catch(function (error) {
        // handle error
        console.log("Error Fetching Data: " + error);
        history.push("/");
      })
      .finally(function () {
        // always executed
      });
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      <div className="container">
        <NavbarComponent />
        <div id="my_clients_dashboard">
          <div className="columns is-centered is-mobile">
            <div className="column">
              <>
                {" "}
                <TableComponent columns={columns} data={result} />
              </>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default HomePage;
